  false,\n\t\"url\": null,\n\t\"notes\": \"These data are from one of from fourteen
  2001 submersible \"Clelia\" dives. Narratives including habitat descriptions and
  estimates of megafaunal species abundance were derived by J. Arcuri from videotapes
  recorded during the dives. The suite of data presented in the Oculina Banks Geographic
  Information System (OGIS) were collected as part of a cooperative project between:
  the National Oceanographic and Atmospheric Administration's (NOAA) Undersea Research
  Program, NOAA Fisheries (also primary sponsor of OGIS), NOAA Ocean Service, NOAA
  Ocean Exploration Program, the U.S. Geological Survey (USGS)-- Coastal and Marine
  Geology Program, Harbor Branch Oceanographic Institution (HBOI) and Florida State
  University. An Oculina Geographic Information System (OGIS) provides a comprehensive,
  interactive data source for the Oculina Banks Habitat Area of Particular Concern
  (OHAPC), a marine protected area off the east coast of Florida in 70 to 120 meters
  of water depth. Data layers include: : multi-beam bathymetry, single-beam bathymetry,
  sidescan mosaics, sediment analyses, resulting interpretative maps of habitat types,
  video and still imagery from submersible (human occupied and remotely operated vehicles)
  dive transects and point counts (fish and habitat cover), and dive narratives.\",\n\t\"owner_org\":
